const YOUTUBE_EMBED_URL = 'https://www.youtube.com/embed/YOUR_VIDEO_ID' // Replace YOUR_VIDEO_ID with your video id

const Sermons = () => {
  return (
    <section className='section sermons' id='sermons'>
      <h2 className='section__title'>설교</h2>
      <div style={{ position: 'relative', paddingBottom: '56.25%', height: 0, width: '100%' }}>
        <iframe
          src={YOUTUBE_EMBED_URL}
          title="YouTube Sermon"
          frameBorder="0"
          allow="accelerometer; autoplay; clipboard-write; encrypted-media; gyroscope; picture-in-picture"
          allowFullScreen
          style={{ position: 'absolute', top: 0, left: 0, width: '100%', height: '100%' }}
        />
      </div>
    </section>
  )
}

export default Sermons
